style.css:
@-moz-document domain("roblox.com") {
/* Custom Background Image */
    body {
        background-image: url('https://c4.wallpaperflare.com/wallpaper/690/498/544/hello-kitty-wallpaper-preview.jpg');  /* Replace YOUR_IMAGE_URL with the link to your background image */
        background-size: cover;
        background-attachment: fixed;
        background-position: center;
        background-repeat: no-repeat;
    }

    /* Custom Button Colors */
    .btn-primary, .btn-secondary, .btn, .navbar .btn, .game-card-button {
        background-color: #FFB6C1 !important;  /* Light Pink */
        border-color: #FF69B4 !important;      /* Dark Pink */
        color: white !important;
    }

    .btn-primary:hover, .btn-secondary:hover, .btn:hover, .game-card-button:hover {
        background-color: #FF69B4 !important;  /* Dark Pink on Hover */
        border-color: #FF69B4 !important;
    }

    /* Custom Profile Colors */
    .profile-header {
        background-color: #FFC0CB !important;  /* Light red-ish pink for profile header */
        color: #ffffff !important;
    }

    .profile-header h2, .profile-header h3 {
        color: #FF69B4 !important;  /* Dark Pink text for profile headings */
    }

    /* Customizing Profile Avatar Background */
    .profile-avatar-container {
        background-color: #FFB6C1 !important;  /* Light Pink */
    }

    /* Navbar Colors */
    .navbar {
        background-color: #FFB6C1 !important;  /* Light Pink for Navbar */
        border-bottom: 2px solid #FF69B4;      /* Dark Pink for Navbar border */
    }

    /* Change color of links on hover */
    a:hover {
        color: #FF69B4 !important; /* Dark Pink for hovered links */
    }

    /* General Text Color */
    body, .text-content, p, span, a {
        color: #FFB6C1 !important;  /* Light Pink text */
    }

    /* Optional: Remove Roblox Ads (if desired) */
    .ad-slot, .ad-container {
        display: none !important;
    }
}
